import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { Link } from 'react-router-dom';
import eye from '../assets/eye.png';
const UserComplaints = ({ user_id }) => {
  const [complaints, setComplaints] = useState([]);

  useEffect(() => {
    const getUserComplaints = async () => {
      try {
        const response = await axios.get(`http://localhost:5000/user/${user_id}/complaints`);
        setComplaints(response.data.complaints);
      } catch (error) {
        console.error(error);
      }
    };
    getUserComplaints();
  }, [user_id]);

  return (
    <div>
      <h1 className='center'>Kullanıcı Arızaları</h1>
      <table className='tablo'>
        <thead>
          <tr>
            <th className='tabloBasligi'>Arıza No</th>
            <th className='tabloBasligi'>Başlık</th>
            <th className='tabloBasligi'>Statü</th>
            <th className='tabloBasligi center'>Detayları Gör</th>
          </tr>
        </thead>
        <tbody>
          {complaints.map((complaint) => (
            <tr key={complaint[0]}> {/* Assuming complaint[0] is the unique identifier (id) */}
              <td className='tabloİcerik'>{complaint[0]}</td>
              <td className='tabloİcerik'>{complaint[2]}</td>
              <td className='tabloİcerik'>{complaint[5]}</td>
              <td className='tabloİcerik center'>
                <Link to={`/complaint/${complaint[0]}`}><img className='kucukikon' src={eye} alt='' /></Link>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
      <div className='centerdiv'>
      <Link to="../create-complaint"><button className='girisbutonlari'>Yeni Şikayet Oluştur</button></Link>
      </div>
    </div>
  );
};

export default UserComplaints;
